pragma solidity ^0 .4.23;
import "./Game.sol";

contract GameManager {
	address[] public contractAddress;
	address public m;

	constructor() public {
		m = msg.sender;
	}
	/*
	 * create a new contract with team name
	 * the manager of this contract is the creator of the contract
	 * return the contract address
	 */
	function createContract(string c1, string c2) public returns (address) {
		require(msg.sender == m);
		address newContract = new Game();
		contractAddress.push(newContract);
		return newContract;
	}

	//get all contract address
	function getAddress() public view returns (address[]) {
		return contractAddress;
	}

}
